<!--Footer-->
<footer id="contact" class="page-footer default_color scrollspy" ng-controller="MsgController">
    <div class="container">  
        <div class="row">
            <div class="col l6 s12">
                <form class="col s12" method="post">
                    <div class="row" ng-model = "message">
                        <div class="input-field col s6">
                            <i class="mdi-action-account-circle prefix white-text"></i>
                            <input id="icon_prefix" name="name" type="text" class="validate white-text" ng-model="message.name">
                            <label for="icon_prefix" class="chatText white-text">First Name</label>
                        </div>
                        <div class="input-field col s6">
                            <i class="mdi-communication-email prefix white-text"></i>
                            <input id="icon_email" name="email" type="email" class="validate white-text" ng-model="message.email">
                            <label for="icon_email" class="chatText white-text">Email-id</label>
                        </div>
                        <div class="input-field col s12">
                            <i class="mdi-editor-mode-edit prefix white-text"></i>
                            <textarea id="icon_prefix2" name="message" class="materialize-textarea white-text" ng-model="message.text"></textarea>
                            <label for="icon_prefix2" class="chatText white-text">Message</label>
                        </div>
                        <div class="col offset-s7 s5">
                            <button class="btn waves-effect waves-light red darken-1" type="submit" ng-click="submitMessage(message)">Submit
                                <i class="mdi-content-send right white-text"></i>
                            </button>
                        </div>
                    </div>
                </form>
            </div>
           <div class="col l6 s12 chatText custom-chatbox" style="max-height: 200px;overflow-y: scroll;">
                <ul class="demo-list-item mdl-list" ng-model="messages">
  <li class="mdl-list__item mdl-list__item-primary-content" ng-repeat="msg in messages">
  <strong style="font-weight: 900;font-size: 17px;">{{msg.name}}</strong> (<small>{{msg.email}}</small>) :<br> {{msg.text}}<br><br>
  </li>
</ul>
            </div>
                  </div>
    </div>
    <div class="footer-copyright default_color">
        <div class="container">
            Made by <a class="white-text" href="https://www.facebook.com/saravanan.sampath.75">Saravanan</a>
        </div>
    </div>
</footer>

    <script src="min/plugin-min.js"></script>
    <script src="min/custom-min.js"></script>
    <script src="js/messages.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/twitter-bootstrap/3.3.7/js/bootstrap.min.js"></script>
    <script type="text/javascript" src="https://code.jquery.com/jquery-1.12.4.min.js"></script>
    <script type="text/javascript" src="bower_components/timelinejs/dist/js/timeline.min.js"></script>
    <script type="text/javascript">
      $(function(){
        $('.js-timeline').Timeline();
        $('.timeline-3').Timeline({
          autoplay: true,
          mode: 'horizontal'
        });
      });
    </script>
     <script src="js/anim.js"></script>
